syntax = "proto3";
import "parking_slot.proto";
import "common.proto";
package autodrive.workflow.proto;


message FusionParkingSlotsMsg {
  // Header
  MsgHeader header = 1;
  // Error
  Error error = 2;
  // parking_slots
  repeated parking_slot.ParkingSlotInfo parking_slots = 3;
  // certified_slots
  repeated int32 certified_slots = 4;
}